import './MovieItem.css';

function contactList(props) {
    return (<div>
        {
            props.contactData.map((singleContact, index) => {
                // Ein Key ist ein Einzigartiger Wert, z.B eine id
                return (<Contact key={index} name={singleContact.name} tel={singleContact.tel} />);
            })}
    </div>);
}

export default MovieItem;
